const tabs=()=>{let t=document.querySelector(".tabs__btn1"),e=document.querySelector(".tabs__btn2"),c=document.querySelector(".tabs__content1"),s=document.querySelector(".tabs__content2");e.addEventListener("click",(function(){e.classList.add("active"),t.classList.remove("active"),s.classList.add("active"),c.classList.remove("active")})),t.addEventListener("click",(function(){e.classList.remove("active"),t.classList.add("active"),c.classList.add("active"),s.classList.remove("active")}))};export default tabs;